css:
@-webkit-keyframes flash {
  from {
    background: #0098ff;
  }
  to {
    background: none;
  }
}
.markdown-preview {
  background-color: #f4f4f4;
  color: #777777;
}
.markdown-preview atom-text-editor {
  background-color: #777777;
  color: #f4f4f4;
}
.atom-text-editor,
:host {
  background-color: #f9f9f9;
  color: #111111;
}
.atom-text-editor .invisible-character,
:host .invisible-character,
.atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(68, 68, 68, 0.2);
}
.atom-text-editor .gutter,
:host .gutter {
  background-color: #efefef;
}
.atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  opacity: 0.5;
}
.atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
.atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
.atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #d33682;
}
.atom-text-editor .selection .region,
:host .selection .region {
  background-color: rgba(220, 50, 47, 0.3);
}
.atom-text-editor .highlights .current-result .region,
:host .highlights .current-result .region {
  background-color: rgba(38, 139, 210, 0.6);
}
.atom-text-editor .highlights .find-result .region,
:host .highlights .find-result .region {
  border-bottom: 1px dotted rgba(38, 139, 210, 0.9) !important;
}
.atom-text-editor .line-number.cursor-line-no-selection,
:host .line-number.cursor-line-no-selection {
  background-color: rgba(0, 0, 0, 0.1);
}
.bracket-matcher .region {
  background-color: #000000;
  opacity: 0.2;
}
.comment {
  color: rgba(119, 119, 119, 0.5);
}
.entity {
  color: #f92672;
}
.keyword {
  color: #f92672;
  font-weight: bold;
}
.storage {
  color: #66d9ef;
}
.storage.type {
  color: #859900;
}
.constant {
  color: #ae81ff;
}
.constant.numeric,
.constant.boolean {
  color: #ae81ff;
}
.variable {
  color: #fd971f;
}
.delimiter,
.brace {
  color: #777777;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #dc322f;
}
.invalid.illegal {
  color: #dc322f;
}
.string {
  color: #de543d;
}
.string .constant.character.escape {
  color: #dc322f;
}
.string.regexp {
  color: #2aa198;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #dc322f;
}
.theme-one-dark-ui .tab-bar .active,
.theme-one-light-ui .tab-bar .active {
  background-color: #e7e7e7 !important;
}
.theme-one-dark-ui .tab-bar .active:after,
.theme-one-light-ui .tab-bar .active:after {
  border-bottom-color: transparent !important;
}
.theme-one-dark-ui .tab-bar .active .title,
.theme-one-light-ui .tab-bar .active .title {
  color: #777777;
  background-color: #e7e7e7 !important;
}
